import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

import EmergenciesList from './components/EmergenciesList';
import HomePage from './components/HomePage';
import Login from './components/Login';
import Register from './components/Register';
import ReportEmergency from './components/ReportEmergency';

import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Emergency Response Management System</h1>
          <nav>
            <Link to="/">Home</Link> | <Link to="/register">Register</Link> | <Link to="/login">Login</Link>
          </nav>
        </header>
        <main className="App-main">
          <Switch>
            <Route path="/" exact component={HomePage} />
            <Route path="/register" component={Register} />
            <Route path="/login" component={Login} />
            <Route path="/report-emergency" component={ReportEmergency} />
            <Route path="/emergencies" component={EmergenciesList} />
          </Switch>
        </main>
      </div>
    </Router>
  );
}

export default App;
